import { createIcon } from "../icon/createIcon";

export const PriceLadderIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="PriceLadderIcon">
    <path d="M3 9v3H2V0h1v2h6V0h1v12H9V9H3zm6-6H3v2h6V3zM3 8h6V6H3v2z" />
  </svg>,
  "PriceLadder",
  "price ladder"
);
